use std::fs::File;
use std::io::{self, Read};
use std::path::Path;
use std::thread;
use std::time::Duration;

use reqwest;
use serde_json::Value;
use tokio;
use tokio_tungstenite::connect_async;
use url::Url;

use clipboard::{ClipboardContext, ClipboardEvent};
use rodio::{Decoder, OutputStream, OutputStreamHandle, Sink};
use rodio::source::{Buffer, BufferSink};

#[tokio::main]
async fn main() {
    // Create a clipboard context
    let mut ctx = ClipboardContext::new().await.unwrap();

    // Create a rodio output stream
    let (_stream, stream_handle) = OutputStream::try_default().unwrap();

    // Create a sink
    let sink = Sink::try_new(&stream_handle).unwrap();

    // Read clipboard contents
    read_clipboard_contents(&mut ctx).await;

    // Convert text to speech using elevenlabs.io api
    let audio_url = convert_text_to_speech("Hello, world!".to_string()).await;

    // Play the audio
    play_audio(&sink, audio_url).await;
}

async fn read_clipboard_contents(ctx: &mut ClipboardContext) {
    // Read clipboard contents
    let contents = ctx.get_contents().await.unwrap();

    // Print the contents
    println!("Clipboard contents: {}", contents);
}

async fn convert_text_to_speech(text: String) -> String {
    // Set the api endpoint and api key
    let endpoint = "https://api.elevenlabs.io/v1/text-to-speech";
    let api_key = "YOUR_API_KEY_HERE";

    // Set the request headers
    let headers = [
        ("Authorization", format!("Bearer {}", api_key)),
        ("Content-Type", "application/json"),
    ];

    // Set the request body
    let body = format!("{{\"text\":\"{}\"}}", text);

    // Send the request
    let response = reqwest::Client::new()
        .post(endpoint)
        .headers(headers)
        .body(body)
        .send()
        .await
        .unwrap();

    // Get the response json
    let json: Value = response.json().await.unwrap();

    // Get the audio url
    let audio_url = json["audio_url"].as_str().unwrap().to_string();

    // Return the audio url
    audio_url
}

async fn play_audio(sink: &Sink, audio_url: String) {
    // Create a buffer
    let buffer = Buffer::new();

    // Create a buffer sink
    let buffer_sink = BufferSink::new(buffer);

    // Add the audio to the buffer sink
    buffer_sink.append(Decoder::new(BufReader::new(Cursor::new(
        reqwest::get(audio_url).await.unwrap().bytes().await.unwrap(),
    ))).await.unwrap());

    // Play the audio
    sink.append(buffer_sink);
}
```

